Ремонт класса бизнес и люкс осуществляется по дизайн-проекту интерьера, разрабатываемому в нашей студии. 

Выполняем высококачественную отделку. Основные особенности:
- натуральный камень;
- художественный паркет;
- авторские витражи и панно;
- венецианская штукатурка;
- дизайнерские потолочные конструкции;
- авторские стеновые панели, двери, колонны...

personalInfo.description:
Наше бюро специализируется на дизайне интерьера в духе уникальной концепции, которую мы называем Парижским стилем. Мы проектируем интерьеры:
- квартир;
- домов и коттеджей; 
- таунхаусов;
- офисов;
сочетая современные дизайнерские тенденции с легким французским шармом.

Также мы осуществляем:
- комплектацию интерьеров; 
- ремонт помещений под ключ.

У нас вы можете заказать 
- стильную мебель, 
- светильники
- декор
по лучшим ценам в Москве, а на последнем этапе оплаты ремонта получить возврат полной стоимости дизайн-проекта интерьера!
